import {Link} from 'react-router-dom';
import './PokemonCard.css';
function PokemonCard(props){
    

    let poke=props.pokemon;
    return (

        <Link to='www.google.com'>
            <img className='' src={poke.image}/>
            <div>
                <h3>{poke.name}</h3>
            </div>
        </Link>
    )
}




export default PokemonCard
